      <div>
        {" "}
         
        <p>
                 
          <h1>
            {lastName},{firstName}
          </h1>
          <ul>Age: {age}</ul>     
          <ul>Hair color: {hairColor}</ul>      
        </p>
      </div>
    );
  }
}
export default PersonCard;
